import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Register.css";
import axios from "axios";

const Register = () => {
  const navigate = useNavigate();

  const [values, setValues] = useState({
    username: "",
    email: "",
    password: "",
    otp: "",
  });

  const [otpSent, setOtpSent] = useState(false);
  const [loading, setLoading] = useState(false);

  const [alert, setAlert] = useState("");
  const [alertType, setAlertType] = useState("");

  const handleChange = (e) => {
    setValues({ ...values, [e.target.name]: e.target.value });
  };

  const requestOtp = async () => {
    if (!values.email) {
      setAlert("Please enter email first");
      setAlertType("error");
      return;
    }

    try {
      setLoading(true);
      const res = await axios.post("http://localhost:3001/api/v1/send-otp", {
        email: values.email,
      });

      setAlert(res.data.message);
      setAlertType("success");
      setOtpSent(true);
    } catch (error) {
      setAlert(error.response?.data?.message || "Failed to send OTP");
      setAlertType("error");
      setTimeout(() => {
        setAlert("");
        setAlertType("");
      }, 1000);
    } finally {
      setLoading(false);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      setLoading(true);
      const res = await axios.post(
        "http://localhost:3001/api/v1/verify-otp",
        values
      );

      setAlert(res.data.message);
      setAlertType("success");

      localStorage.setItem("token", res.data.token);
      window.dispatchEvent(new Event("authChange"));

      setTimeout(() => {
        navigate("/");
      }, 1000);
    } catch (error) {
      setAlert(error.response?.data?.message || "Registration failed");

      setTimeout(() => {
        setAlertType("error");
      }, 1000);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="body">
      <div className="Register">
        <div>
          <Link to="/" type="back" className="backBtn">
            Back
          </Link>
          <h1>Register</h1>
          {alert && <div className={`alert ${alertType}`}>{alert}</div>}
          <form onSubmit={handleSubmit}>
            <div>
              <label htmlFor="username">Username</label>
              <input
                type="text"
                placeholder="Enter Username"
                name="username"
                onChange={handleChange}
              />
            </div>
            <div>
              <label htmlFor="email">Email</label>
              <input
                type="email"
                placeholder="Enter Email"
                name="email"
                onChange={handleChange}
              />
            </div>
            {!otpSent && (
              <button type="button" onClick={requestOtp}>
                Request OTP
              </button>
            )}
            {otpSent && (
              <>
                <label htmlFor="otp">Enter OTP:</label>
                <input
                  type="otp"
                  placeholder="Enter Otp"
                  name="otp"
                  className="otpEnter"
                  onChange={handleChange}
                />
                <button>Verify</button>
              </>
            )}
            <div>
              <label htmlFor="password">Password</label>
              <input
                type="password"
                placeholder="Enter Password"
                name="password"
                onChange={handleChange}
              />
            </div>

            <button>Submit</button>
          </form>
          <div>
            <p>Already have account</p>
            <Link to="/Login">Login</Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
